  display: none;
}
.carousel-control-next {
  display: none;
}
::ng-deep .carousel .carousel-indicators ol {
  position: absolute;
  right: 0%;
  /* left: 0; */
  bottom: 0;
  z-index: 15;
  display: -ms-flexbox;
  display: block !important;
  -ms-flex-pack: center;
  /* justify-content: center; */
  padding-left: 0;
  margin-right: 6% !important;
  margin-left: 15%;
  list-style: none;
}
.carousel .carousel-indicators li {
  width: 0.625rem;
  height: 0.625rem;
  border-radius: 8%;
  cursor: pointer;
  color: red;
}
.img-responsive-icon {
  width: 18px;
  height: 18px;
}
.social-icons {
  display: -ms-flexbox;
  display: flex;
  float: right;
}
.social-icons ul {
  display: inline-block;
}
.social-icons .social-icon {
  height: 18px;
  width: 18px;
  display: inline-block;
  margin: 0 0px 0 10.9px;
}

.bs-switch {
  position: relative;
  display: inline-block;
  width: 60px;
  height: 34px;
}
.bs-switch input {
  display: none;
}
.bs-switch input:checked + .slider {
  background-color: #2196f3;
}
.bs-switch input:checked + .slider:before {
  -ms-transform: translateX(26px);
      transform: translateX(26px);
}
.bs-switch input:focus + .slider {
  box-shadow: 0 0 1px #2196f3;
}
.bs-switch .slider {
  position: absolute;
  cursor: pointer;
  top: 0;
  left: 0;
  right: 0;
  bottom: 0;
  background-color: #ccc;
  transition: 0.4s;
}
.bs-switch .slider:before {
  position: absolute;
  content: "";
  height: 26px;
  width: 26px;
  left: 4px;
  bottom: 4px;
  background-color: white;
  transition: 0.4s;
}
.bs-switch .slider.round {
  border-radius: 34px;
}
.bs-switch .slider.round:before {
  border-radius: 50%;
}
